StringTokenizer st = new StringTokenizer(searchString, ":");
String searchID = st.nextToken().trim();
String searchTypeName = st.nextToken().trim();

def SearchTypeInfo
for (def tSearchTypeInfo : searchTypeInfoList) {
  String tString = tSearchTypeInfo.getSearchType();
  if (tString.equalsIgnoreCase(searchTypeName)) {
    SearchTypeInfo = tSearchTypeInfo
  }
}

def datasetTemp = myClientHelper.getNetSuiteSavedSearchDataset(NetSuiteUser,NetSuitePassword,NetSuiteAccountID,
                    NetSuiteApplicationID,NetSuiteVersion,SearchTypeInfo,searchID)
def con = odiRef.getJDBCConnection( "DEST" )
try {
  stmt = con.createStatement()
  def dataSetRows = datasetTemp.getDatasetRows();
  for (OdiNetSuiteSavedSearchRow dataSetRow: dataSetRows) {
    def colString = ""
    def valueString = ""
    def firstOne = true
    def rowColumns = dataSetRow.getRowColumns();
    for (def rowColumn: rowColumns) {
      String tColName = rowColumn.getColName();
      String tColValue = rowColumn.getColValue();
      if (!firstOne) {
        colString += ", "
        valueString += ", "
      }
      colString   += tColName
      valueString += "'" + tColValue + "'"
      firstOne     = false
    }
    def sql = "insert into " + targetTable + " (" + colString + ") values (" + valueString + ")"
print "Load SOAP Data - " +  sql + ";\n"
    result = stmt.executeUpdate( sql )
  }
} finally {
    if (stmt != null) { stmt.closeOnCompletion() }
